const hllP = 14                                                             // The greater is P, the smaller the error.
const hllQ = 64 - hllP                                                      // The number of bits of the hash value used for determining the number of leading zeros.
const hllRegisters = 1 << hllP                                              // With P=14, 16384 registers.
const hllPMask = hllRegisters - 1                                           // Mask to index register.
const hllBits = 6                                                           // Enough to count up to 63 leading zeroes.
const hllRegisterMax = (1 << hllBits) - 1                                   // Max value of a register.
const hllHdrSize = /*4 + /* magic */ 1 /* storage type */ + 3 /* N/U */ + 8 /* Cache cardin. */
const hllDenseSize = hllHdrSize + (hllRegisters*hllBits+7)/8
const hllDense encoding = 0 // Dense encoding.
const hllSparseSize = hllHdrSize + hllRegisters*2
const hllSparse encoding = 1 // Sparse encoding.
const hllRawSize = hllHdrSize + hllRegisters
const hllMaxEncoding = 1

type encoding int

type Hll struct {
	card       uint16
	enc        encoding
	regsDense  []uint8
	regsSparse map[int32]byte
}

func parseRedisHll(b []byte) (Hll, error) {
	h := Hll{}
	if len(b) < 1 {
		return h, errors.New("invalid hll")
	}
	if string(b[:4]) == "HYLL" {
		b = b[4:]
	}

	h.card = binary.LittleEndian.Uint16(b[4:hllHdrSize])

	switch b[0] {
	case byte(hllDense):
		h.enc = hllDense

		h.regsDense = b[hllHdrSize:]
	case byte(hllSparse):
		h.enc = hllSparse
		//h.regsSparse = b[:]
	default:
		return h, errors.New("unsupported hll storage")
	}

	return h, nil
}
func (h *Hll) toRedis() []byte {
	bytes := make([]byte, hllHdrSize+len(h.regsDense)+4)
	copy(bytes[:4], "HYLL")
	bytes[5] = byte(h.enc)
	binary.LittleEndian.PutUint16(bytes[8:4+hllHdrSize], h.card)
	copy(bytes[4+hllHdrSize:], h.regsDense)
	return bytes
}

func divideBy8RoundUp(i int) int {
	result := i >> 3
	if remainder := i & 0x7; remainder > 0 {
		result++
	}
	return result
}

func (h Hll) toHLLGob() ([]byte, error) {
	var regs []uint8
	for i := 0; i < hllRegisters; i++ {
		pos := i * hllBits / 8
		fb := i * hllBits & 7
		fb8 := 8 - fb
		b0 := h.regsDense[pos]

		var b1 byte = 0
		if pos+1 < len(h.regsDense) {
			b1 = h.regsDense[pos+1]
		}

		reg := ((b0 >> fb) | (b1 << fb8)) & hllRegisterMax
		regs = append(regs, reg)
	}

	buf := bytes.Buffer{}
	enc := gob.NewEncoder(&buf)
	if err := enc.Encode(regs); err != nil {
		return nil, err
	}
	if err := enc.Encode(uint32(hllRegisters)); err != nil {
		return nil, err
	}
	if err := enc.Encode(uint8(hllP)); err != nil {
		return nil, err
	}
	return buf.Bytes(), nil
}

/**
 * The following is converting redis HLL to go HLL
 */
func redisHllToBytes(b []byte) ([]byte, error) {
	if string(b[:4]) == "HYLL" {
		b = b[4:]
	}

	bytesNeeded := len(b) - hllHdrSize
	bytes := make([]byte, 3 /*header bytes*/ +bytesNeeded)

	regwidth := hllBits
	log2m := hllP
	bytes[1] = byte(((regwidth - 1) << 5) | log2m)

	var cutoff byte = 16
	var regs []byte
	switch b[0] {
	case 0x00:
		bytes[0] = (1 << 4) | byte(4) /* HLL_DENSE */

	case 0x01:
		bytes[0] = (1 << 4) | byte(3) /* HLL_SPARSE */
		cutoff |= 1 << 6
		regs = b[12:]

		bitsPerRegister := int(regwidth + log2m)
		regMask := byte((1 << uint(regwidth)) - 1)

		// take the floor of the number of bits divided by the width of the regnum + width
		numRegisters := (8 * len(b[12:])) / bitsPerRegister
		_, _ = numRegisters, regMask
	default:
		return nil, fmt.Errorf("invalid encoding")
	}
	cacheCardin := binary.LittleEndian.Uint16(b[4:12])
	fmt.Println(cacheCardin)

	bytes[2] = cutoff

	var i int = 3
	for _, v := range regs {
		bytes[i] = v
		i++
	}

	return bytes, nil
}
